import React, { Component } from "react";
import { StyleSheet, View, StatusBar } from "react-native";
import Bar from "./components/Bar";
import Previous from "./components/Previous";
import Calling from "./components/Calling";

function Game(props) {
  return (
    <React.Fragment>
      <View style={styles.prevContainer}>
        <Previous style={styles.previous}></Previous>
      </View>
      <View style={styles.container}>
        <StatusBar hidden />

        <View style={styles.callingContainer}></View>
        <Calling style={styles.calling}></Calling>
        <View style={styles.rect}></View>
        <Bar />
      </View>
    </React.Fragment>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 5,
    backgroundColor: "rgba(236,236,236,1)",
  },
  bar: {
    height: 98,
    marginTop: 20,
  },
  barContainer: {
    flexDirection: "row",
    flex: 1,
    bottom: 0,
  },
  rect: {
    width: 347,
    height: 203,
    backgroundColor: "rgba(255,255,255,1)",
    borderRadius: 10,
    alignSelf: "center",
    marginTop: 30,
  },
  previous: {
    height: 80,
    width: "100%",
    marginTop: 10,
  },
  prevContainer: {
    alignSelf: "center",
    flex: 1,
  },
  calling: {
    height: 170,
    width: 170,
    alignSelf: "center",
  },
  callingContainer: {
    justifyContent: "center",
    alignContent: "center",
    margin: 30,
  },
});

export default Game;
